import User from './User'

const UserPage = (props: {users: Array<string>, popup: (type: string, name?: string) => void}) =>{

const popup = (type:string, name?: string) => {
  props.popup(type, name)
}

  return(
    <div>
    {props.users.map(user => {return <User popup={popup} key={user} name={user}/>})}
    </div>
  )
}

export default UserPage
